import React, { Component } from "react";
import { Link, withRouter } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { registerUser, logoutUser } from "../../actions/authAutentications";
import classnames from "classnames";


//componenti da react-bootstrap
import { Container } from 'react-bootstrap';

//componenti da material-ui
import TextField from '@material-ui/core/TextField';
import DatePicker from 'react-datepicker';
import "react-datepicker/dist/react-datepicker.css";



class NuovaPrenotazione extends Component {
  constructor() {
    super();
    this.state = {
      ora_partenza: "",
      partenza: "",
      ora_arrivo: "",
      data_partenza: "",
      data_arrivo: "",
      destinazione: "",
      parcheggio_partenza: "",
      parcheggio_destinazione: "",
      idVeicolo: "",
      idCliente: "",
      idAutista: "",
      errors: {}
    };
  }


  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors
      });
    }
  }

  onChange = e => {
    this.setState({ [e.target.id]: e.target.value });
  };

  onSubmit = e => {
    e.preventDefault();

    const newPrenotazione = {
        ora_partenza: this.state.ora_partenza,
        partenza: this.state.partenza,
        ora_arrivo: this.state.ora_arrivo,
        data_partenza: this.state.data_partenza,
        data_arrivo: this.state.data_arrivo,
        destinazione: this.state.destinazione,
        parcheggio_partenza: this.state.parcheggio_partenza,
        parcheggio_destinazione: this.state.parcheggio_destinazione,
        idVeicolo: this.state.idVeicolo,
        idCliente: this.state.idCliente,
        idAutista: this.state.idAutista
    };

    this.props.registerPrenotazione(newPrenotazione, this.props.history);
  };

  render() {
    const { errors } = this.state;
    return (
      <Container style={{marginTop: '3rem', marginBottom: '3rem'}}>
      <div className="Form">
            <form noValidate onSubmit={this.onSubmit}>
            <h3 style={{textAlign: 'center', color: 'black'}}>Nuova Prenotazione</h3>
              <div className="form-group">
              <label htmlFor="partenza">Partenza</label>
                <input
                  onChange={this.onChange}
                  value={this.state.partenza}
                  error={errors.partenza}
                  id="name"
                  type="text"
                  className={classnames("form-control", {
                    invalid: errors.partenza
                  })}
                />
                <span className="red-text">{errors.partenza}</span>
              </div>
              <div className="form-group">
              <label htmlFor="cognome">Destinazione</label>
                <input
                  onChange={this.onChange}
                  value={this.state.cognome}
                  error={errors.cognome}
                  id="cognome"
                  type="text"
                  className={classnames("form-control", {
                    invalid: errors.cognome
                  })}
                />
                <span className="red-text">{errors.cognome}</span>
              </div>
              <div className="form-group">
          <DatePicker
              selected={ this.state.startDate }
              onChange={ this.handleChange }
              name="startDate"
              dateFormat="MM/dd/yyyy"
          />
          <button className="btn btn-primary">Show Date</button>
        </div>
              <div className="form-group">
              <label htmlFor="cf">Codice Fiscale</label>
                <input
                  onChange={this.onChange}
                  value={this.state.cf}
                  error={errors.cf}
                  id="cf"
                  type="text"
                  className={classnames("form-control", {
                    invalid: errors.cf
                  })}
                />
                <span className="red-text">{errors.cf}</span>
              </div>
             
                <div className="form-group">
              <label htmlFor="luogo_nascita">Luogo di nascita</label>
                <input
                  onChange={this.onChange}
                  value={this.state.luogo_nascita}
                  error={errors.luogo_nascita}
                  id="luogo_nascita"
                  type="text"
                  className={classnames("form-control", {
                    invalid: errors.luogo_nascita
                  })}
                />
                <span className="red-text">{errors.luogo_nascita}</span>
              </div>
              <div className="form-group">
                    <label>Provincia di nascita</label>
                    <select id="provincia_nascita" type="text" value={this.state.provincia_nascita} 
                    onChange={this.onChange} error={errors.provincia_nascita}
                    className={classnames("form-control", {
                      invalid: errors.provincia_nascita
                    })}>
                    <option value="" disabled selected>Provincia di Nascita</option>
                    <option value="Agrigento">Agrigento</option>
                    <option value="Caltanissetta">Caltanissetta</option>
                    <option value="Catania">Catania</option>
                    <option value="Enna">Enna</option>
                    <option value="Messina">Messina</option>
                    <option value="Palermo">Palermo</option>
                    <option value="Ragusa">Ragusa</option>
                    <option value="Siracusa">Siracusa</option>
                    <option value="Trapani">Trapani</option>
                    </select>
                    <span className="red-text">{errors.provincia_nascita}</span>
                </div>
              <div className="form-group">
              <label htmlFor="patente">Numero Patente</label>
                <input
                  onChange={this.onChange}
                  value={this.state.patente}
                  error={errors.patente}
                  id="patente"
                  type="text"
                  className={classnames("form-control", {
                    invalid: errors.patente
                  })}
                />
                <span className="red-text">{errors.patente}</span>
              </div>
              <div className="form-group">
              <label htmlFor="email">Email</label>
                <input
                  onChange={this.onChange}
                  value={this.state.email}
                  error={errors.email}
                  id="email"
                  type="email"
                  className={classnames("form-control", {
                    invalid: errors.email
                  })}
                />
                <span className="red-text">{errors.email}</span>
              </div>
              <div className="form-group">
              <label htmlFor="password">Password</label>
                <input
                  onChange={this.onChange}
                  value={this.state.password}
                  error={errors.password}
                  id="password"
                  type="password"
                  className={classnames("form-control", {
                    invalid: errors.password
                  })}
                />
                <span className="red-text">{errors.password}</span>
              </div>
              <div className="form-group">
              <label htmlFor="password2">Conferma Password</label>
                <input
                  onChange={this.onChange}
                  value={this.state.password2}
                  error={errors.password2}
                  id="password2"
                  type="password"
                  className={classnames("form-control", {
                    invalid: errors.password2
                  })}
                />
                <span className="red-text">{errors.password2}</span>
              </div>
              <button type="submit" value="Registrazione Log" className="btn btn-dark btn-lg btn-block">Registrati</button>
